import React from "react";
import IconLinkedin from "../icons/linkedin"
import IconInstagram from "../icons/instagram";
import IconGitHub from "../icons/github";

const Socials = () => {
    return (
        <div className="flex flex-col min-w-36 items-center justify-end h-svh">
            <div className="flex flex-col">
                <a>
                    ABOUT
                </a>
                <a>
                    EXPERIENCE
                </a>
                <a>
                    PROJECTS
                </a>
            </div>
            <div className="absolute z-10 gap-6 w-full h-fit pb-16 pt-6 flex flex-col items-center ">
                <a href='https://www.linkedin.com/in/katherineytye/' className="transition ease-in-out duration-300 hover:-translate-y-2"> <IconLinkedin/></a>
                <a href='https://www.instagram.com/_chezkath/' className="transition ease-in-out duration-300 hover:-translate-y-2"> <IconInstagram/></a>
                <a href='https://github.com/kyoety' className="transition ease-in-out duration-300 hover:-translate-y-2"> <IconGitHub/></a>
            </div>

        </div>
    );
};  

export default Socials;
